SELECT SUM(Revenue) AS Total_Revenue
FROM meta_campaigns
WHERE Placement LIKE 'Instagram_%';

SELECT Gender, AVG(ROAS) as Average_ROAS
FROM meta_campaigns
GROUP BY Gender;

SELECT Campaign_Name 
FROM meta_campaigns 
WHERE ROAS > 5;

SELECT Placement, SUM(Link_Clicks) / SUM(Impressions) AS Link_Click_Rate
FROM meta_campaigns
GROUP BY Placement;

SELECT Campaign_Name, CTR 
FROM meta_campaigns 
WHERE CTR > 2.5;

SELECT Placement, SUM(Post_Reactions) AS Total_Reactions, SUM(Post_Comments) AS Total_Comments, SUM(Post_Shares) AS Total_Shares
FROM meta_campaigns
GROUP BY Placement;

SELECT Gender, Age, SUM(Reach) as Total_Reach
FROM meta_campaigns
GROUP BY Gender, Age;

SELECT Campaign_Name 
FROM meta_campaigns 
WHERE Spend > 50000;
